//pass in ControlName to validate a single item or nothing to validate everything.
var ErrorReporting = true;
var RunAll = false;
if (ControlName == null) {
    RunAll = true;
}


if (ControlName == 'First Name' || RunAll) {
    if (VV.Form.Global.CentralValidation(VV.Form.GetFieldValue('First Name'), 'Blank') == false) {
        VV.Form.SetValidationErrorMessageOnField('First Name', 'A value needs to be entered for the First Name.');
        ErrorReporting = false;
    }
    else {
        VV.Form.ClearValidationErrorOnField('First Name');
    }
}

if (ControlName == 'Last Name' || RunAll) {
    if (VV.Form.Global.CentralValidation(VV.Form.GetFieldValue('Last Name'), 'Blank') == false) {
        VV.Form.SetValidationErrorMessageOnField('Last Name', 'A value needs to be entered for the Last Name.');
        ErrorReporting = false;
    }
    else {
        VV.Form.ClearValidationErrorOnField('Last Name');
    }
}

if (ControlName == 'Email' || RunAll) {
    if (VV.Form.Global.CentralValidation(VV.Form.GetFieldValue('Email'), 'Blank') == false) {
        VV.Form.SetValidationErrorMessageOnField('Email', 'Please enter the Email in the form of a valid Email.');
        ErrorReporting = false;
    }
    else {
        if (VV.Form.Global.CentralValidation(VV.Form.GetFieldValue('Email'), 'Email') == false) {
            VV.Form.SetValidationErrorMessageOnField('Email', 'Please enter the Email in the form of a valid Email.');
            ErrorReporting = false;
        }
        else {
            VV.Form.ClearValidationErrorOnField('Email');
        }
    }
}

//Add other validation as appropriate to the implementation.

if (ErrorReporting == false) {
    return false;
} else {
    return true;
}

var validationResults = VV.Form.Template.FormValidation();

if (validationResults == true) {

    var okfunction = function () {
        VV.Form.Template.DisableUser();
    }

    var cancelfunction = function () {
        return;
    }

    //Display confirmation message
    var messageData = 'You have indicated that this user account should be disabled. If you continue, this user will no longer be able to log in. Click OK to continue or Cancel to go back.';
    var res = VV.Form.Global.DisplayConfirmMessaging(messageData, 'Confirm Action', okfunction, cancelfunction);
}
else {
    var messageData = 'All of the fields have not been filled in completely or there is an issue with the range of the data entered.  Highlight your mouse over the red icon to see how you can resolve the error stopping you from saving this form.';
    VV.Form.Global.DisplayMessaging(messageData, 'Missing Information');
}

var validationResults = VV.Form.Template.FormValidation();

if (validationResults == true) {

    var okfunction = function () {
        VV.Form.Template.CreateUserSimple();
    }

    var cancelfunction = function () {
        return;
    }

    //Display confirmation message
    var messageData = 'You have indicated that you would like to create this user account. If you continue, an email will be sent to the user with login instructions. Click OK to continue or Cancel to go back.';
    var res = VV.Form.Global.DisplayConfirmMessaging(messageData, 'Confirm Action', okfunction, cancelfunction);
}
else {
    var messageData = 'All of the fields have not been filled in completely or there is an issue with the range of the data entered.  Highlight your mouse over the red icon to see how you can resolve the error stopping you from saving this form.';
    VV.Form.Global.DisplayMessaging(messageData, 'Missing Information');
}

var validationResults = VV.Form.Template.FormValidation();

if (validationResults == true) {
    VV.Form.Template.Save();
}
else {
    var messageData = 'All of the fields have not been filled in completely or there is an issue with the range of the data entered.  Highlight your mouse over the red icon to see how you can resolve the error stopping you from saving this form.';
    VV.Form.Global.DisplayMessaging(messageData, 'Missing Information');
}

var validationResults = VV.Form.Template.FormValidation();

if (validationResults == true) {

    var okfunction = function () {
        VV.Form.Template.EnableUser();
    }

    var cancelfunction = function () {
        return;
    }

    //Display confirmation message
    var messageData = 'You have indicated that this user account should be enabled. If you continue, this user will now be able to log in. Click OK to continue or Cancel to go back.';
    var res = VV.Form.Global.DisplayConfirmMessaging(messageData, 'Confirm Action', okfunction, cancelfunction);
}
else {
    var messageData = 'All of the fields have not been filled in completely or there is an issue with the range of the data entered.  Highlight your mouse over the red icon to see how you can resolve the error stopping you from saving this form.';
    VV.Form.Global.DisplayMessaging(messageData, 'Missing Information');
}
